{
  "translationLines": [
    {
      "lineNumber": 155821,
      "originalJapaneseLine": "「……サテラが捕まって",
      "translatedEnglishLine": "\"...Satera was captured,"
    },
    {
      "lineNumber": 155822,
      "originalJapaneseLine": "　身代わりにイシスが潰された結界だ」",
      "translatedEnglishLine": "and to take her place, Isis was crushed by the barrier.\""
    },
    {
      "lineNumber": 155823,
      "originalJapaneseLine": "「そうよー。",
      "translatedEnglishLine": "\"That's right."
    },
    {
      "lineNumber": 155824,
      "originalJapaneseLine": "　人類が魔人に対して",
      "translatedEnglishLine": "It's humanity's only method to stand against the demons"
    },
    {
      "lineNumber": 155825,
      "originalJapaneseLine": "　カオスと日光以外で唯一対抗できる方法」",
      "translatedEnglishLine": "other than Chaos and sunlight.\""
    },
    {
      "lineNumber": 155826,
      "originalJapaneseLine": "「ふふふ、そのことをすっかり失念したのが",
      "translatedEnglishLine": "\"Hehehe, forgetting that completely"
    },
    {
      "lineNumber": 155827,
      "originalJapaneseLine": "　運の尽きねー♪」",
      "translatedEnglishLine": "was the end of his luck♪\""
    },
    {
      "lineNumber": 155828,
      "originalJapaneseLine": "「ぽち袋、聖の指輪、ビリケンさん、うしミイラ。",
      "translatedEnglishLine": "\"Little envelopes, holy rings, Billiken, the cow mummy."
    },
    {
      "lineNumber": 155829,
      "originalJapaneseLine": "　さすがに急だったから聖遺物を",
      "translatedEnglishLine": "Since it was sudden, preparing these holy relics"
    },
    {
      "lineNumber": 155830,
      "originalJapaneseLine": "　用意するのは少し大変だったけどね」",
      "translatedEnglishLine": "was a bit of a hassle though.\""
    },
    {
      "lineNumber": 155831,
      "originalJapaneseLine": "「だ、駄目だ！　こんなの！」",
      "translatedEnglishLine": "\"N-No! This can't be!\""
    },
    {
      "lineNumber": 155832,
      "originalJapaneseLine": "「これすごく痛いんだ！",
      "translatedEnglishLine": "\"This hurts so much!"
    },
    {
      "lineNumber": 155833,
      "originalJapaneseLine": "　早くシルキィを出してくれ！」",
      "translatedEnglishLine": "Let Silky out quickly!\""
    },
    {
      "lineNumber": 155834,
      "originalJapaneseLine": "「まーだまだ！",
      "translatedEnglishLine": "\"Not yet, not yet!"
    },
    {
      "lineNumber": 155835,
      "originalJapaneseLine": "　シルキィが戦えなくなるまで駄目だ！」",
      "translatedEnglishLine": "You can't until Silky can't fight anymore!\""
    },
    {
      "lineNumber": 155836,
      "originalJapaneseLine": "「戦場を我が物のように駆け回り、",
      "translatedEnglishLine": "\"The demon who ran around the battlefield as if it were his own,"
    },
    {
      "lineNumber": 155837,
      "originalJapaneseLine": "　リーザス兵を振り回し続けた魔人が……",
      "translatedEnglishLine": "swinging Lizard soldiers about..."
    },
    {
      "lineNumber": 155838,
      "originalJapaneseLine": "　こんな簡単に……」",
      "translatedEnglishLine": "He was defeated this easily...\""
    },
    {
      "lineNumber": 155839,
      "originalJapaneseLine": "「どこに来るか分かってたからな」",
      "translatedEnglishLine": "\"Because I knew where he would come.\""
    },
    {
      "lineNumber": 155840,
      "originalJapaneseLine": "「サテラにシルキィはいい奴と聞いた」",
      "translatedEnglishLine": "\"I heard from Satera that Silky is a good guy.\""
    },
    {
      "lineNumber": 155841,
      "originalJapaneseLine": "「お互いに一番被害が出ない方法は",
      "translatedEnglishLine": "\"The way for both sides to suffer the least damage"
    },
    {
      "lineNumber": 155842,
      "originalJapaneseLine": "　頭だけを潰すことだ」",
      "translatedEnglishLine": "is to crush only the head.\""
    },
    {
      "lineNumber": 155843,
      "originalJapaneseLine": "「あああぁあああああぁぁああ！」",
      "translatedEnglishLine": "\"Aaaaahhhhhhhh!\""
    },
    {
      "lineNumber": 155844,
      "originalJapaneseLine": "ついには甲冑をその形のまま留めることも出来ず、",
      "translatedEnglishLine": "In the end, the armor could no longer hold its shape,"
    },
    {
      "lineNumber": 155845,
      "originalJapaneseLine": "中のシルキィが姿を現した。",
      "translatedEnglishLine": "and Silky inside revealed himself."
    },
    {
      "lineNumber": 155846,
      "originalJapaneseLine": "「おほー！　こないだは顔だけだったが、",
      "translatedEnglishLine": "\"Oho! Last time it was just the face,"
    },
    {
      "lineNumber": 155847,
      "originalJapaneseLine": "　全体見てもグッドじゃないか！」",
      "translatedEnglishLine": "but seeing the whole body, it's good, isn't it!\""
    },
    {
      "lineNumber": 155848,
      "originalJapaneseLine": "「くっ、見ていられない……",
      "translatedEnglishLine": "\"Ugh, I can't watch this..."
    },
    {
      "lineNumber": 155849,
      "originalJapaneseLine": "　頼む、ランス……シルキィを……」",
      "translatedEnglishLine": "Please, Rance... Silky...\""
    },
    {
      "lineNumber": 155850,
      "originalJapaneseLine": "「うむ、そろそろいいかな」",
      "translatedEnglishLine": "\"Hmm, I think now is a good time.\""
    },
    {
      "lineNumber": 155851,
      "originalJapaneseLine": "「シルキィ降参しろ！",
      "translatedEnglishLine": "\"Silky, surrender!"
    },
    {
      "lineNumber": 155852,
      "originalJapaneseLine": "　そうしたら命だけは助けてやるぞー！」",
      "translatedEnglishLine": "If you do, I'll spare your life!\""
    },
    {
      "lineNumber": 155853,
      "originalJapaneseLine": "（……貞操は知らんがな）",
      "translatedEnglishLine": "(...Though your chastity, I can't promise.)"
    },
    {
      "lineNumber": 155854,
      "originalJapaneseLine": "「あがっ！　が、ぐっ、あっ！」",
      "translatedEnglishLine": "\"Agh! Guh, ugh, ah!\""
    },
    {
      "lineNumber": 155855,
      "originalJapaneseLine": "「こら！　聞いてるのか！",
      "translatedEnglishLine": "\"Hey! Are you listening?!"
    },
    {
      "lineNumber": 155856,
      "originalJapaneseLine": "　死にたくないなら無茶せずに降参しろ！」",
      "translatedEnglishLine": "If you don't want to die, don't be reckless and surrender!\""
    },
    {
      "lineNumber": 155857,
      "originalJapaneseLine": "「だ、駄目だ。",
      "translatedEnglishLine": "\"N-No."
    },
    {
      "lineNumber": 155858,
      "originalJapaneseLine": "　シルキィは頑固だから",
      "translatedEnglishLine": "Silky is stubborn,"
    },
    {
      "lineNumber": 155859,
      "originalJapaneseLine": "　きっと死んでも降参なんて……」",
      "translatedEnglishLine": "he definitely won't surrender even if he dies...\""
    },
    {
      "lineNumber": 155860,
      "originalJapaneseLine": "「ちっ、厄介な奴だな……",
      "translatedEnglishLine": "\"Tch, what a troublesome guy..."
    },
    {
      "lineNumber": 155861,
      "originalJapaneseLine": "　ならマリス、封印の解除を――」",
      "translatedEnglishLine": "Then Maris, release the seal—\""
    },
    {
      "lineNumber": 155862,
      "originalJapaneseLine": "「ちょ、ちょっと待って下さい！",
      "translatedEnglishLine": "\"W-Wait a moment!"
    },
    {
      "lineNumber": 155863,
      "originalJapaneseLine": "　魔人シルキィの様子が……！」",
      "translatedEnglishLine": "The demon Silky's condition...!\""
    },
    {
      "lineNumber": 155864,
      "originalJapaneseLine": "「くっ、ぐ、うっ……！",
      "translatedEnglishLine": "\"Ugh, guh, ugh...!\""
    },
    {
      "lineNumber": 155865,
      "originalJapaneseLine": "　うぁああぁあああ！」",
      "translatedEnglishLine": "\"Waaahhhhh!\""
    },
    {
      "lineNumber": 155866,
      "originalJapaneseLine": "「なっ――！」",
      "translatedEnglishLine": "\"Wha—!\""
    },
    {
      "lineNumber": 155867,
      "originalJapaneseLine": "結界の力を引き千切るように、",
      "translatedEnglishLine": "As if tearing apart the power of the barrier,"
    },
    {
      "lineNumber": 155868,
      "originalJapaneseLine": "一歩一歩、自力で歩き出した。",
      "translatedEnglishLine": "step by step, Silky began to walk on his own."
    },
    {
      "lineNumber": 155869,
      "originalJapaneseLine": "「馬鹿！　無茶するなシルキィ！",
      "translatedEnglishLine": "\"Fool! Don't be reckless, Silky!"
    },
    {
      "lineNumber": 155870,
      "originalJapaneseLine": "　体がバラバラになるぞ！」",
      "translatedEnglishLine": "Your body will fall apart!\""
    },
    {
      "lineNumber": 155871,
      "originalJapaneseLine": "「くっ、リア様下がって下さい！」",
      "translatedEnglishLine": "\"Ugh, Lady Ria, please step back!\""
    },
    {
      "lineNumber": 155872,
      "originalJapaneseLine": "「うわ、マリスすごい汗！　大丈夫！？",
      "translatedEnglishLine": "\"Wow, Maris, you're sweating a lot! Are you okay?!\""
    },
    {
      "lineNumber": 155873,
      "originalJapaneseLine": "い、いえ……駄目です……",
      "translatedEnglishLine": "N-No... It's no good..."
    },
    {
      "lineNumber": 155874,
      "originalJapaneseLine": "　全力でやっているのに……とても……",
      "translatedEnglishLine": "I'm doing my best... but it's really..."
    },
    {
      "lineNumber": 155875,
      "originalJapaneseLine": "「まずい！　結界が――ッ！」",
      "translatedEnglishLine": "\"This is bad! The barrier—!\""
    },
    {
      "lineNumber": 155876,
      "originalJapaneseLine": "「ぐ、うっ……！」",
      "translatedEnglishLine": "\"Guh, ugh...!\""
    },
    {
      "lineNumber": 155877,
      "originalJapaneseLine": "「あぁああああぁあああぁああああ！！！！」",
      "translatedEnglishLine": "\"Aaaaaaahhhhhhhhhhhhh!!!!\""
    },
    {
      "lineNumber": 155878,
      "originalJapaneseLine": "そしてシルキィは自力で結界を破った。",
      "translatedEnglishLine": "And then, Silky broke through the barrier on his own."
    },
    {
      "lineNumber": 155879,
      "originalJapaneseLine": "「な、なんだとーッ！？」",
      "translatedEnglishLine": "\"W-What the—?!\""
    },
    {
      "lineNumber": 155880,
      "originalJapaneseLine": "「……驚きましたね。」",
      "translatedEnglishLine": "\"...That was surprising, wasn't it?\""
    }
  ]
}

